import React from "react";
import { Route } from "react-router-dom";
import { connect } from "react-redux";

import CollectionOverview from "../../componemts/collection-overview/CollectionOverview";
import Collections from "../collections/Collections";
import { fetchCollectionStartAsync } from "../../redux/shop/shop.action";
import WithSpinner from "../../componemts/with-spinner/WithSpinner";

const CollectionOverviewWithSpinner = WithSpinner(CollectionOverview);

const CollectionsWithSpinner = WithSpinner(Collections);

class Shop extends React.Component {
  unsubcribedCollection = null;
  state = { isLoading: true };

  componentDidMount() {
    const { fetchCollectionStartAsync } = this.props;
  }

  render() {
    const { match } = this.props;
    const { isLoading } = this.state;
    return (
      <div>
        <Route
          exact
          path={`${match.path}`}
          render={(props) => (
            <CollectionOverviewWithSpinner isLoading={isLoading} {...props} />
          )}
        />
        <Route
          path={`${match.path}/:collectionId`}
          render={(props) => (
            <CollectionsWithSpinner isLoading={isLoading} {...props} />
          )}
        />
      </div>
    );
  }
}

export default connect(null, { fetchCollectionStartAsync })(Shop);
